import React from 'react';
import { useHistory } from 'react-router-dom';

function Dashboard() {
    const history = useHistory();

    const handleSelectTool = (tool) => {
        history.push(`/tools/${tool}`);
    };

    return (
        <div>
            <h1>Dashboard</h1>
            <button onClick={() => handleSelectTool('salessearcher')}>Sales Searcher</button>
            <button onClick={() => handleSelectTool('oosspotter')}>OOS Spotter</button>
            <button onClick={() => handleSelectTool('ordersync')}>Order Sync</button>
        </div>
    );
}

export default Dashboard;
